(166, 2, '2019-12-12 08:03:10', '2019-12-12 08:03:10', '<p><b>ideas </b>that Suit\'s your</p><p>Needs</p>		\n			<a href=\"https://m.me/Sushen.Biswas.Creative.Director\" role=\"button\">\n						KNOW MORE\n					</a>\n		<p><strong>Services</strong> we provide</p>		\n			<h2>Designing</h2>		\n		<p>We design Your needs, Design always gives the right mood.</p>		\n			<h2>Security</h2>		\n		<p>We know what to secure and how to secure it. We always understand your concern.</p>		\n			<h2>Development</h2>		\n		<p>Devloping thing is a continus process . We use CD/CI to give you transprant devlopment. </p>		\n			<h2>AI</h2>		\n		<p>AI always helps you to make quicker decisions so you can take care of your mental and physical health.</p>		\n			<h2>Marketing</h2>		\n		<p>You find the most productive marketing to us. Our Marketing cashflow design is the best.</p>		\n			<h2>Payments</h2>		\n		<p>Use all king of Cashless system so you don\'t have to worry about counting.</p>		\n		<p><strong>Who</strong> we are</p><p>We are the people who build the next dackys tools.</p><p>AI and humans are started working the previous dacky now we are surrounding with AI. Make a scalable world can make the best predictive decision. We can\'t tell what will happen but we cant tell you what is not going to happen.</p>		\n			<a href=\"#\" role=\"button\">\n						KNOW MORE\n					</a>\n		https://www.youtube.com/watch?v=WD00qC-copw		\n		<p>Our <strong>Products</strong></p>		\n		[products limit=\"4\" columns=\"4\" ]		\n		<p><strong>Contact</strong> Us</p>		\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=gulshan&amp;t=m&amp;z=16&amp;output=embed&amp;iwloc=near\" aria-label=\"gulshan\"></iframe>		\n		<p>121/C, Gulshan Avenue</p><p>Dhaka -1212</p>		\n               <form action=\"\" method=\"post\" id=\"form_1\" enctype=\"multipart/form-data\">\n                <h1>Contact Us</h1><label>Name</label>\n        <input id=\"name_1\" type=\"text\" name=\"name_1\" value=\"\" required placeholder=\"Name\" />\n        <label>Email</label>\n        <input id=\"email_2\" type=\"email\" name=\"email_2\" required value=\"\" placeholder=\"Email\" />\n        <label>Contact No</label>\n        <input id=\"number_3\" type=\"number\" name=\"number_3\" required value=\"\" placeholder=\"Contact number\" />\n        <label>Message</label>\n            <textarea id=\"message_4\" name=\"message_4\" value=\"Message\" placeholder=\"Message\" required></textarea>\n            <label><input id=\"0\" type=\"submit\" name=\"submit\" value=\"Submit\"/>\n                </label>\n                <input type=\"hidden\" name=\"hidden_field\" value=\"1\"/>\n                <input type=\"hidden\" value=\"disable\"/>\n                </form><p style=\"display:none\" redirect=\"\">Thank You ...</p>', 'Agency Home', '', 'publish', 'closed', 'closed', '', 'agency-home', '', '', '2020-03-13 11:58:42', '2020-03-13 11:58:42', '', 0, 'https://wpzita.com/zitademo/agency/?page_id=2', 0, 'page', '', 0),
